import React, { Component } from 'react'

export class Results extends Component {
    state = {
        books : []
    };

    componentDidMount() {
        // Start fetching the repos when the component is first displayed
        fetch('https://www.googleapis.com/books/v1/volumes?q={henry}')
            .then(res => res.json())
            // .then(data => console.log(data));
            .then(books => this.setState({books}));
            // .then(data => data.items.map(item => console.log(item.volumeInfo)));
    }

    render() {
        console.log(this.state)
        let items = this.state.books.map(item => <p>{item.title}</p>) 

        return (
            <div>
                <ul>
                    {items}
                </ul>
            </div>
        )
    }
}

export default Results
